let ParentDeviceName = "Cooler Master ARGB Controller";
export function SupportsSubdevices(){ return true; }
const DeviceMaxLedLimit = 196;
//Channel Name, Led Limit
let ChannelArray = [
	["Channel 1", 48],
	["Channel 2", 48],
	["Channel 3", 48],
	["Channel 4", 48],
];

function SetupChannels(){
	device.SetLedLimit(DeviceMaxLedLimit);

	for(let i = 0; i < ChannelArray.length; i++){
		device.addChannel(ChannelArray[i][0], ChannelArray[i][1]);
	}
}


function InitChannels(){
	sendPacketString("00 80 17 02", 65);   //Init Custom Mode ARGB
}

export function Initialize() {
	SetupChannels();
}

export function Shutdown() {

}

const vKeyNames = [];
const vKeyPositions = [];

let RGBConfigs = {
	"RGB" : [0, 1, 2],
	"RBG" : [0, 2, 1],
	"BGR" : [2, 1, 0],
	"BRG" : [2, 0, 1],
	"GBR" : [1, 2, 0],
	"GRB" : [1, 0, 2]
};

let savedMotherboardPass;

function setMotherboardPass(){
	savedMotherboardPass = MotherboardPass;

	if(savedMotherboardPass){
		sendPacketString("00 80 17 02", 65);
		sendPacketString("00 80 01 02", 65);
		sendPacketString("00 80 01 02", 65);
		sendPacketString("00 80 01 02", 65);
		sendPacketString("00 80 01 02", 65);
		sendPacketString("00 80 01 04 01", 65); //RGB header

	}else{
		sendPacketString("00 80 01 01", 65);

	}
}


export function LedNames() {
	return vKeyNames;
}

export function LedPositions() {
	return vKeyPositions;
}

function SendChannel(Channel, shutdown = false) {

	let ChannelLedCount = device.channel(ChannelArray[Channel][0]).ledCount;
	let componentChannel = device.channel(ChannelArray[Channel][0]);

	let RGBData = [];

	if(LightingMode === "Forced"){
		RGBData = device.createColorArray(forcedColor, ChannelLedCount, "Inline");

	}else if(componentChannel.shouldPulseColors()){
		ChannelLedCount = 48;

		let pulseColor = device.getChannelPulseColor(ChannelArray[Channel][0], ChannelLedCount);
		RGBData = device.createColorArray(pulseColor, ChannelLedCount, "Inline");

	}else{
		RGBData = device.channel(ChannelArray[Channel][0]).getColors("Inline");
	}

	// while(RGBData.length < 61 * 3){
	//     RGBData.push(0)
	// }


	var packet = [];
	packet[0] = 0x00;
	packet[1] = 0x00;
	packet[2] = 0x10;
	packet[3] = 0x02;
	packet[4] = Channel;
	packet[5] = 0x30;
	packet = packet.concat(RGBData.splice(0, 59));
	device.write(packet, 65);

	var packet = [];
	packet[0] = 0x00;
	packet[1] = 0x01;
	packet = packet.concat(RGBData.splice(0, 63));
	device.write(packet, 65);

	var packet = [];
	packet[0] = 0x00;
	packet[1] = 0x82;
	packet = packet.concat(RGBData.splice(0, 62));
	device.write(packet, 65);
}

function sendRGBHeader(shutdown = false){
	sendPacketString("00 80 01 03", 65);

	let packet = [];
	packet[0] = 0x00;
	packet[1] = 0x80;
	packet[2] = 0x04;
	packet[3] = 0x05;//mode?
	packet[4] = 0x10;
	packet[5] = 0x02;
	packet[6] = 0xFF; //Brightess

	if(savedRGBHeader){
		let iPxX = RGB_Header.positioning[0][0];
		let iPxY = RGB_Header.positioning[0][1];
		let mxPxColor;

		//find colors
		if(shutdown){
			mxPxColor = hexToRgb(shutdownColor);
		}else if (LightingMode === "Forced") {
			mxPxColor = hexToRgb(forcedColor);
		}else{
			mxPxColor = device.subdeviceColor("RGBHeader", iPxX, iPxY);
		}

		//set colors
		packet[7] = mxPxColor[RGBConfigs[RGBconfig][0]];
		packet[8] = mxPxColor[RGBConfigs[RGBconfig][1]];
		packet[9] = mxPxColor[RGBConfigs[RGBconfig][2]];
		device.write(packet, 65);

	}
}

let savedRGBHeader;

function setRGBHeader(){
	if(savedRGBHeader != RGBHeaderToggle){
		savedRGBHeader = RGBHeaderToggle;

		if(!savedRGBHeader){
			device.removeSubdevice("RGBHeader");
		}else{
			//"Ch1 | Port 1"
			device.createSubdevice("RGBHeader");
			// Parent Device + Sub device Name + Ports
			device.setSubdeviceName("RGBHeader", `${ParentDeviceName} - ${RGB_Header.displayName}`);
			device.setSubdeviceImage("RGBHeader", RGB_Header.image);
			device.setSubdeviceSize("RGBHeader", RGB_Header.width, RGB_Header.height);
			device.setSubdeviceLeds("RGBHeader",
				RGB_Header.LedNames,
				RGB_Header.positioning);

		}
	}
}


export function Render() {

	if(MotherboardPass){
		if(savedMotherboardPass != MotherboardPass){
			setMotherboardPass();
		}else{
			device.pause(30);
			device.pause(30);
		}
	}else{
		//InitChannels();
		if(savedMotherboardPass != MotherboardPass){
			setMotherboardPass();
		}

		SendChannel(0);
		device.pause(1);
		SendChannel(1);
		device.pause(1);
		SendChannel(2);
		device.pause(1);
		SendChannel(3);
		device.pause(1);
		sendRGBHeader();
	}

	setRGBHeader();
}

function sendPacketString(string, size){

	let packet= [];
	let data = string.split(' ');

	for(let i = 0; i < data.length; i++){
		packet[i] = parseInt(data[i], 16);//.toString(16)
	}

	device.write(packet, size);
}

function hexToRgb(hex) {
	let result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
	let colors = [];
	colors[0] = parseInt(result[1], 16);
	colors[1] = parseInt(result[2], 16);
	colors[2] = parseInt(result[3], 16);

	return colors;
}

